import React, { useEffect, useState } from 'react';
import './styles.css';

const DocumentForm = () => {
  const [formInfo, setFormInfo] = useState(null);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const apiUrl = 'https://old.verif.tools/api/integration/generator-full-information/usa_passport'; // Replace with the correct endpoint
    const username = 'badboujiestore@gmail.com'; // Username for Basic Auth
    const password = 'badboujiestore@gmail.com'; // Password for Basic Auth

    // Encoding username and password for Basic Authentication
    const basicAuth = 'Basic ' + btoa(`${username}:${password}`);

    fetch(apiUrl, {
      headers: {
        'Content-Type': 'application/json',
        'Authorization': basicAuth
      }
    })
    .then(response => {
      if (!response.ok) {
        throw new Error(`Network response was not ok, status: ${response.status}`);
      }
      return response.json();
    })
    .then(data => {
      setFormInfo(data);
      setIsLoading(false);
    })
    .catch(error => {
      console.error('Error fetching document info:', error);
      setError(error.message);
      setIsLoading(false);
    });
  }, []);

  // Function to render form fields based on the API response
  const renderFormFields = (fields) => {
    return fields.map(field => (
      <div key={field.id}>
        <label>{field.input_label}</label>
        <input type={field.type} name={field.input_name} defaultValue={field.value} required={field.required} />
      </div>
    ));
  };

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div className="form-container">
      {formInfo && (
        <>
          <h2>{formInfo.name}</h2>
          {formInfo.steps && formInfo.steps.map(step => (
            <div key={step.id}>
              <h3>{step.name}</h3>
              {renderFormFields(step.fields)}
            </div>
          ))}
        </>
      )}
    </div>
  );
};

export default DocumentForm;
